import { useState } from 'react';

interface e {
    target: {
        value: string
    }
}

const Login = (): JSX.Element => {

    let [id, setId] = useState('');
    let [pw, setPw] = useState('');

    const onIDChange = (e: e): void => {
        setId(e.target.value)
    };

    const onPasswordChange = (e: e): void => {
        setPw(e.target.value)
    };

    return (
        <div id="login-wrapper">
            <form action="" method="post">
                <table>
                    <thead>
                        <tr>
                            <td>
                                로그인
                            </td>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>ID</td>
                        </tr>
                        <tr>
                            <input type="text" value={id} onChange={onIDChange} />                            
                        </tr>
                        <tr>
                            <td>Password</td>
                        </tr>
                        <tr>
                            <input type="password" name="" id="" value={pw} onChange={onPasswordChange} />
                        </tr>
                    </tbody>
                    <tfoot>
                        <tr>
                            <td><button type="submit">Sign In</button></td>
                        </tr>
                    </tfoot>
                </table>             
            </form>
  
        </div>

    );
}

export default Login;
